/* eslint-disable */
import "@babel/polyfill";
import { register } from "./register";
import { login, logout } from "./login";
import { sendFile } from "./sendFile";
import { sendEth } from "./sendEth";
import { buyGold, buyPreminum } from "./upgradeAccount";

// DOM ELEMENTS
const registerFrom = document.querySelector(".form--register");
const loginForm = document.querySelector(".form--login");
const logOutBtn = document.querySelector(".nav__el--logout");
const sendFileForm = document.querySelector(".form--sendFile-user-send");
const sendTransactionForm = document.querySelector(".form--sendEth");
const buyGoldForm = document.querySelector(".buy-Gold-form");
const buyPreminumForm = document.querySelector(".buy-Preminum-form");

if (registerFrom)
  registerFrom.addEventListener("submit", (e) => {
    e.preventDefault();
    const passwordConfirm = document.getElementById("passwordConfirm").value;
    const password = document.getElementById("password").value;
    console.log(password, passwordConfirm);
    register(passwordConfirm, password);
  });

if (loginForm)
  loginForm.addEventListener("submit", (e) => {
    e.preventDefault();
    const PrivateKey = document.getElementById("PrivateKey").value;
    const password = document.getElementById("password").value;
    login(PrivateKey, password);
  });

if (logOutBtn) logOutBtn.addEventListener("click", logout);
if (buyGoldForm) buyGoldForm.addEventListener("click", buyGold);
if (buyPreminumForm) buyPreminumForm.addEventListener("click", buyPreminum);

if (sendFileForm)
  sendFileForm.addEventListener("submit", (e) => {
    e.preventDefault();
    const myFile = document.getElementById("myFile").files[0];
    console.log(myFile);
    sendFile(myFile);
  });

if (sendTransactionForm)
  sendTransactionForm.addEventListener("submit", (e) => {
    e.preventDefault();
    const to = document.getElementById("to").value;
    const value = document.getElementById("value").value;
    sendEth(to, value);
  });
